CREATE TABLE `ordine` (
  `acquirente` varchar(50) NOT NULL,
  `ora_ordine` datetime NOT NULL,
  `stato` enum('In composizione','In attesa di accettazione','In attesa di conferma','Annullato','In consegna','Consegnato') DEFAULT 'In composizione',
  `metodo_pagamento` enum('Carta di credito','Contanti') DEFAULT 'Carta di credito',
  `prezzo_tot` float(6,2) NOT NULL DEFAULT 0.00,
  `fattorino` varchar(50) DEFAULT NULL,
  `ora_accettazione` time DEFAULT NULL,
  `tempistica_consegna` time DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

--
-- Trigger `ordine`
--
DELIMITER $$
CREATE TRIGGER `tr_credito_after_update_fattorino` AFTER UPDATE ON `ordine` FOR EACH ROW IF(OLD.fattorino IS NULL AND NEW.fattorino IS NOT NULL) THEN
    UPDATE Fattorino SET credito = credito + NEW.prezzo_tot*1/10
    WHERE Fattorino.email = NEW.fattorino;
END IF
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `tr_credito_after_update_stato` AFTER UPDATE ON `ordine` FOR EACH ROW IF(OLD.stato = 'In attesa di conferma' AND NEW.stato = 'Annullato') THEN
    UPDATE Fattorino SET credito = credito - NEW.prezzo_tot*1/10
    WHERE Fattorino.email = NEW.fattorino;
END IF
$$
DELIMITER ;

