--
-- Struttura della tabella `rigaordine`
--

CREATE TABLE `rigaordine` (
  `n_riga` int(11) NOT NULL,
  `acquirente` varchar(50) NOT NULL,
  `ora_ordine` datetime NOT NULL,
  `ristorante` varchar(50) NOT NULL,
  `nome_prodotto` varchar(50) NOT NULL,
  `prezzo` float(5,2) NOT NULL,
  `quantità` int(11) DEFAULT 1
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

--
-- Trigger `rigaordine`
--
DELIMITER $$
CREATE TRIGGER `tr_prezzo_tot_after_decrementing_quantità` AFTER UPDATE ON `rigaordine` FOR EACH ROW IF(OLD.quantità > NEW.quantità) THEN
    UPDATE Ordine SET prezzo_tot = prezzo_tot - NEW.prezzo*(OLD.quantità - NEW.quantità)
    WHERE NEW.acquirente = Ordine.acquirente
    AND NEW.ora_ordine = Ordine.ora_ordine;
END IF
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `tr_prezzo_tot_after_delete_RigaOrdine` AFTER DELETE ON `rigaordine` FOR EACH ROW UPDATE Ordine SET prezzo_tot = prezzo_tot -OLD.prezzo*OLD.quantità
WHERE Ordine.ora_ordine = OLD.ora_ordine
AND Ordine.acquirente = OLD.acquirente
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `tr_prezzo_tot_after_incrementing_quantità` AFTER UPDATE ON `rigaordine` FOR EACH ROW IF(OLD.quantità < NEW.quantità) THEN
    UPDATE Ordine SET prezzo_tot = prezzo_tot + NEW.prezzo*(NEW.quantità - OLD.quantità)
    WHERE NEW.acquirente = Ordine.acquirente
    AND NEW.ora_ordine = Ordine.ora_ordine;
END IF
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `tr_prezzo_tot_after_insert_RigaOrdine` AFTER INSERT ON `rigaordine` FOR EACH ROW UPDATE Ordine SET prezzo_tot = NEW.prezzo*NEW.quantità + prezzo_tot
WHERE Ordine.ora_ordine = NEW.ora_ordine
AND Ordine.acquirente = NEW.acquirente
$$
DELIMITER ;

